 <j>Refletz#6472 (Soristl)<n><br><br>AR Tłumaczenie: <j>Ionut_eric_pro#1679<n><br><br>FR Tłumaczenie: <j>Rowed#4415<n><br><br>PL Tłumaczenie: <j>Prestige#5656<n>",messageSetMaxPlayers="Z maksymalną liczbą graczy umieszczoną dla",newPassword="Nowe hasło:",passwordRemoved="<bv>Hasło usunięte<n>",messageMaxPlayersAlert="<bv>Maksymalna liczba graczy musi wynosić minimum 6, a maksimum 20<n>",previousMessage="<p align='center'>Powrót",nextMessage="<p align='center'>Następny",realModeRules="<p align='center'><font size='16px'>Zasady trybu Volley Real Mode<br><br><p align='left'><font size='12px'><b>- Każda drużyna może się zmienić <b>transform</b> w <vi>okrągły obiekt<n> tylko 3 razy (nielicząc <b>serwa</b> który jest tylko raz)<br><br>- Jeśli piłka wyląduje poza boiskiem po stronie twojego zespołu i <b>nikt</b> z twojej drużyny nie przekształcił się w <vi>okrągły obiekt<n> wtedy punkt jest zdobyty przez twoją drużynę<br><br>- Jeśli piłka wylądowała poza boiskiem i ktoś z twojej drużyny <b>zmienił się w</b> <vi><b>okrągły obiekt<b><n> wtedy punkt należy do drużyny przeciwnej<br><br>- Każdy z graczy serwuje raz <br><br>- Jeśli zawodnik opuści boisko, będzie mógł wykonać akcję przez <j>7 sekund<n>, w przeciwnym razie zawodnik nie będzie mógł użyć <j>klawiszu spacji<n><br><br>- Klawisze 1, 2, 3 i 4 zmieniają siłę gracza",titleSettings="<p align='center'><font size='16px'>Ustawienia pokoju</p>",textSettings="<p align='left'><font size='12px'>Wybierz tryb gry<br><br><br><br>Aktywuj !randomball dowodzenie<br><br><br><br>Aktywuj !randommap dowodzenie<br><br><br><br>Aktywuj !twoballs dowodzenie</p>",msgAchievements="<p align='left'><font size='14px'>Osiągnięcia:",msgsTrophies={[1]="Trofeum Pucharu Świata w siatkówce",[2]="FootVolley Ultimate Team Badge",[3]="Puchar Świata w piłce siatkowej",[4]="Volley Roulette badge",[5]="Volley Wild Card badge"},mapSelect='Wybierz mapę'}if tfm.get.room.language=="br"then r=s.br elseif tfm.get.room.language=="en"then r=s.en elseif tfm.get.room.la